const arrVBA = [
  "https://www.youtube.com/embed/AsgDfoLF3WU",
  "https://www.youtube.com/embed/AsgDfoLF3WU",
];

const getVideoList = () => {
  return (
    <React.Fragment>
      {arrVBA.map((video, index) => {
        return (
          <div key={index} className="col-4">
            <iframe
              src={video}
              frameBorder="0"
              allow="accelerometer; encrypted-media; gyroscope; picture-in-picture"
              allowFullScreen
            ></iframe>
          </div>
        );
      })}
    </React.Fragment>
  );
};

const Media = () => (
  <div>
    <h1>Youtube Code goes here</h1>
    <div className="row">{getVideoList()}</div>
  </div>
);

export default Media;
